import AnimalItems from "./animalItems";


const animalList = ({ animals }) => {
        return (
            <ul>
                {animals
                .map((animal) => {
                    return (
                        <AnimalItems animal={animal} />
                    );
                })}
            </ul>
        )
}

export default animalList;
